INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (4, 0, 111011, 11, 1110501, 1, 1110501043, 1, 0, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", "", 0, 91, 1110501, "", 1110501044, "", "", "", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (0, "", "vo_adv_1110501", 21, 1110501, 0, 1110501045, "", "", "vo_adv_1110501_002", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (4, 0, 111011, 11, 1110501, 1, 1110501046, 1, 0, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", "", 0, 91, 1110501, "", 1110501047, "", "", "", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (0, "", "vo_adv_1110501", 21, 1110501, 0, 1110501048, "", "", "vo_adv_1110501_003", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES (5, 0, 111011, 11, 1110501, 1, 1110501049, 1, 0, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", "");
INSERT INTO `v1_54efc602e070152378651e07e15662371ff6d4af9166382816f9ad655528c820` VALUES ("", "", 0, 91, 1110501, "", 1110501050, "", "", "", "");
